import { useEffect } from "react";
import moment from "jalali-moment";

export const ConvertData = ({ data }) => {
  useEffect(() => {
    let todayJalali = moment(data.created_at).locale("fa").format("YYYY/M/D");
    console.log(todayJalali);
  }, []);
  return (
    <div>
      {todayJalali}
      <td></td>
    </div>
  );
};
